import React from "react";

function UserData() {
  // Declare a new state variable, which we'll call "count"
  const data = [
    {
      id: 1,
      name: "Mitesh",
      email: "mitesh@gmail.com",
      status: "active",
    },
    {
      id: 2,
      name: "Jack",
      email: "jack@gmail.com",
      status: "active",
    },
    {
      id: 3,
      name: "Ali",
      email: "Ali@gmail.com",
      status: "inactive",
    },
    {
      id: 4,
      name: "Neel",
      email: "neel@gmail.com",
      status: "inactive",
    },
    {
      id: 5,
      name: "Jonny",
      email: "Jonny@gmail.com",
      status: "active",
    },
  ];
  return <data></data>;
}
export default UserData;
